import React from 'react';
import { Typography } from '@material-ui/core';

const HomePage = () => {
    return (
        <div style={{backgroundImage:`url(${"images/mcewanhall.jpg"})`,
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat',
        height:'600px',
        opacity:'75%',}}>
            <Typography
            display="block"
            justifyContent="center"
            align="right"
            variant="h1"
            style={{opacity:'100%', color:'white', padding:'30px', fontWeight:'bold'}}>
                Andrea Husseiniova
            </Typography>

        </div>
    )
}

export default HomePage;
